package net.minidev.ovh.api.dedicatedcloud.vendor;

/**
 * Representation of a Vendor object in OVH API
 */
public class OvhOvhId {
	/**
	 * Vm id
	 *
	 * canBeNull
	 */
	public Long vmId;

	/**
	 * Datacenter id
	 *
	 * canBeNull
	 */
	public Long datacenterId;

	/**
	 * Filer id
	 *
	 * canBeNull
	 */
	public Long filerId;

	/**
	 * Host id
	 *
	 * canBeNull
	 */
	public Long hostId;
}
